[{"location":"#Modified-Hankel-Functions-of-Order-One-Third-1","page":"Home","title":"Modified Hankel Functions of Order One Third","text":"","category":"section"},{"location":"#","page":"Home","title":"Home","text":"Solutions to Stokes' differential equation:","category":"page"},{"location":"#","page":"Home","title":"Home","text":"(Image: \\frac{\\mathrm{d}^2u}{\\mathrm{d}z^2} + zu = 0)","category":"page"},{"location":"#","page":"Home","title":"Home","text":"","category":"page"},{"location":"#Solutions-1","page":"Home","title":"Solutions","text":"","category":"section"},{"location":"#","page":"Home","title":"Home","text":"Two solution approaches are used. If abs2(z) < 36, a power series solution is used. Otherwise, an asymptotic expansion is performed because of floating point limits in the power series.","category":"page"},{"location":"#Usage-1","page":"Home","title":"Usage","text":"","category":"section"},{"location":"#","page":"Home","title":"Home","text":"using ModifiedHankelFunctionsOfOrderOneThird\r\n\r\nh1, h2, h1′, h2′ = modifiedhankel(z)","category":"page"},{"location":"pages/api/#API-1","page":"API","title":"API","text":"","category":"section"},{"location":"pages/api/#","page":"API","title":"API","text":"modifiedhankel(z)\r\nModifiedHankelFunctionsOfOrderOneThird.powerseries(z)\r\nModifiedHankelFunctionsOfOrderOneThird.asymptotic(z)","category":"page"},{"location":"pages/api/#ModifiedHankelFunctionsOfOrderOneThird.modifiedhankel-Tuple{Any}","page":"API","title":"ModifiedHankelFunctionsOfOrderOneThird.modifiedhankel","text":"modifiedhankel(z)\n\nReturn h₁, h₂, h₁′, and h₂′, the first and second modified Hankel functions of order 1/3 and their derivatives.\n\nThese functions solve Stokes' equation d²udz² + zu = 0 as a power series in z for abs(z) < 6 and an approximate asymptotic expansion otherwise. The asymptotic solution is necessary because the z³ⁱ in the power series blows up as i  .\n\nReferences\n\n[1]: The Staff of the Computation Library (1945), Tables of the modified Hankel function of order one-third and of their derivatives. Cambridge, MA: Harvard University Press.\n\nSee also: powerseries, asymptotic\n\n\n\n\n\n","category":"method"},{"location":"pages/api/#ModifiedHankelFunctionsOfOrderOneThird.powerseries-Tuple{Any}","page":"API","title":"ModifiedHankelFunctionsOfOrderOneThird.powerseries","text":"powerseries(z)\n\nReturn h₁, h₂, h₁′, and h₂′, the first and second modified Hankel functions of order 1/3 and their derivatives using a power series.\n\nThese functions solve Stokes' equation d²udz² + zu = 0 as a power series in z, valid in the entire complex plane.\n\nReferences\n\n[1]: The Staff of the Computation Library (1945), Tables of the modified Hankel function of order one-third and of their derivatives. Cambridge, MA: Harvard University Press.\n\nSee also: modifiedhankel, asymptotic\n\n\n\n\n\n","category":"method"},{"location":"pages/api/#ModifiedHankelFunctionsOfOrderOneThird.asymptotic-Tuple{Any}","page":"API","title":"ModifiedHankelFunctionsOfOrderOneThird.asymptotic","text":"asymptotic(z)\n\nReturn h₁, h₂, h₁′, and h₂′, the first and second modified Hankel functions of order 1/3 and their derivatives using an asymptotic expansion.\n\nTwo separate functions, valid across separate ranges of arg(z) are necessary to cover the full region of the complex plane. This is an example of Stokes' phenomenon, the existence of two expressions of different forms which represent asymptotically the same integral function.\n\nFor h₁ on -2π3  arg z  4π3:\n\nh₁(z)  α z^-14 e^23 i z^32 - 5πi12 left( 1 + sum_m=1 (-i)^m C_m z^-3m2 right)\n\nh₁(z)  α i z^14 e^23 i z^32 - 5πi12 left( 1 + sum_m=1 (-i)^m C_m z^-3m2 right) -\n    α4 z^-54 e^23 i z^32 - 5πi12 left( 1 + sum_m=1 (-i)^m C_m z^-3m2 right) -\n    32 α z^-14 e^23 i z^32 - 5πi12 left( sum_m=1 (-i)^m m C_m z^-3m2 - 1 right)\n\nwhere\n\nC_m = frac(9-4)(81-4)cdots (92m-1^2-4)2^4m3^m m\n\nand\n\nh₁(z)  h₁(z) + α z^-14 e^-23 i z^32 - 11πi12 left( 1 + sum_m_1 (i)^m C_m z^-3m2 right)\n\nh₁(z)  h₁(z) - α z^14 e^-23 i z^32 - 11πi12 left( 1 + sum_m_1 (i)^m C_m z^-3m2 right) -\n    α4 z^-54 e^-23 i z^32 - 11πi12 left( 1 + sum_m_1 (i)^m C_m z^-3m2 right) -\n    32 α z^-14 e^-23 i z^32 - 11πi12 left( sum_m=1 i^m m C_m z^-3m2 - 1 right)\n\nfor -4π3  arg z  0.\n\nAnd for h₂ on -4π3  arg z  2π3:\n\nh₂(z)  α z^-14 e^-23 i z^32 + 5πi12 left( 1 + sum_m=1 (i)^m C_m z^-3m2 right)\n\nh₂(z)  -α z^14 e^-23 i z^32 + 5πi12 left( 1 + sum_m=1 (i)^m C_m z^-3m2 right) -\n    α4 z^-54 e^-23 i z^32 + 5πi12 left( 1 + sum_m=1 (i)^m C_m z^-3m2 right) -\n    32 α z^-14 e^-23 i z^32 + 5πi12 left( i^m m C_m z^-3m2 - 1 right)\n\nand\n\nh₂(z)  h₂(z) + α z^-14 e^23 i z^32 + 11πi12 left( 1 + sum_m=1 (-i)^m C_m z^-3m2 right)\n\nh₂(z)  h₂(z) + α z^14 e^23 i z^32 + 11πi12 left( 1 + sum_m=1 (-i)^m C_m z^-3m2 right) -\n    α4 z^-54 e^23 i z^32 + 11πi12 left( 1 + sum_m=1 (-i)^m C_m z^-3m2 right) -\n    32 α z^-14 e^23 i z^32 + 11πi12 left( sum_m=1 (-i)^m m C_m z^-3m2 - 1 right)\n\nfor 0  arg z  4π3.\n\nReferences\n\n[1]: The Staff of the Computation Library (1945), Tables of the modified Hankel function of order one-third and of their derivatives. Cambridge, MA: Harvard University Press.\n\nSee also: modifiedhankel, powerseries\n\n\n\n\n\n","category":"method"}]
